  return (
    <Fragment>
      <div className="heading__primary-small bg-white">Confirm</div>
      <div className="heading__secondary-small">
        Are you sure you want to add these songs to {name}?
      </div>
      <Button
        type={"primary"}
        title={"Yes!"}
        action={() => {}}
        colors={{
          backgroundColor: "rgb(255, 78, 80)",
          color: "#fff"
        }}
      />
    </Fragment>
  );
};
